void model_init(){
    conv2d_5_data = init_conv2d_5_data();
    batch_normalization_398_data = init_batch_normalization_398_data();
    separable_conv2d_9_data = init_separable_conv2d_9_data();
    batch_normalization_399_data = init_batch_normalization_399_data();
    separable_conv2d_10_data = init_separable_conv2d_10_data();
    batch_normalization_400_data = init_batch_normalization_400_data();
    separable_conv2d_11_data = init_separable_conv2d_11_data();
    batch_normalization_401_data = init_batch_normalization_401_data();
    dense_81_data = init_dense_81_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    prepare_buffers();
    
    //*************** LAYER 0 **************//
    // Layer name: conv2d_5
    data3d_t output0;
    // convert image for first EmbedIA Conv2d layer
    image_adapt_layer(input, &output0);
    input = output0;
    
     conv2d_layer(conv2d_5_data, input, &output0);
    
    //*************** LAYER 1 **************//
    // Layer name: max_pooling2d_132
    input = output0;
    static const pooling2d_layer_t max_pooling2d_132_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_132_data, input, &output0);
    
    //*************** LAYER 2 **************//
    // Layer name: batch_normalization_398
    batch_normalization3d_layer(batch_normalization_398_data, &output0);
    
    //*************** LAYER 3 **************//
    // Layer name: activation_406
    tanh_activation(output0.data, 3600);
    //tanh_activation(output0.data, 3600);
    
    //*************** LAYER 4 **************//
    // Layer name: separable_conv2d_9
    input = output0;
    // convert image for first EmbedIA Conv2d layer
    image_adapt_layer(input, &output0);
    input = output0;
    
    separable_conv2d_layer(separable_conv2d_9_data, input, &output0);
    
    //*************** LAYER 5 **************//
    // Layer name: batch_normalization_399
    batch_normalization3d_layer(batch_normalization_399_data, &output0);
    
    //*************** LAYER 6 **************//
    // Layer name: activation_407
    tanh_activation(output0.data, 10816);
    //tanh_activation(output0.data, 10816);
    
    //*************** LAYER 7 **************//
    // Layer name: separable_conv2d_10
    input = output0;
    separable_conv2d_layer(separable_conv2d_10_data, input, &output0);
    
    //*************** LAYER 8 **************//
    // Layer name: max_pooling2d_133
    input = output0;
    static const pooling2d_layer_t max_pooling2d_133_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_133_data, input, &output0);
    
    //*************** LAYER 9 **************//
    // Layer name: batch_normalization_400
    batch_normalization3d_layer(batch_normalization_400_data, &output0);
    
    //*************** LAYER 10 **************//
    // Layer name: activation_408
    tanh_activation(output0.data, 2400);
    //tanh_activation(output0.data, 2400);
    
    //*************** LAYER 11 **************//
    // Layer name: separable_conv2d_11
    input = output0;
    separable_conv2d_layer(separable_conv2d_11_data, input, &output0);
    
    //*************** LAYER 12 **************//
    // Layer name: average_pooling2d_20
    input = output0;
    static const pooling2d_layer_t average_pooling2d_20_data = { 3, 3 };
    avg_pooling2d_layer(average_pooling2d_20_data, input, &output0);
    
    //*************** LAYER 13 **************//
    // Layer name: batch_normalization_401
    batch_normalization3d_layer(batch_normalization_401_data, &output0);
    
    //*************** LAYER 14 **************//
    // Layer name: activation_409
    tanh_activation(output0.data, 512);
    //tanh_activation(output0.data, 512);
    
    //*************** LAYER 15 **************//
    // Layer name: flatten_82
    input = output0;
    data1d_t output1;
    flatten3d_layer(input, &output1);
    
    //*************** LAYER 16 **************//
    // Layer name: dropout_82
    data1d_t input1;
    input1 = output1;
    
    
    //*************** LAYER 17 **************//
    // Layer name: dense_81
    input1 = output1;
    dense_layer(dense_81_data, input1, &output1);
    
    
    //*************** LAYER 18 **************//
    // Layer name: activation_410
    softmax_activation(output1.data, 10);
    //softmax_activation(output1.data, 10);
    

    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

